import React from "react";

import { Wrap, FlexItem, FlexItems } from "../styles/Partners";
import Count from "./Count";

function Partners() {
  return <Wrap>
      <div className="container">
          <FlexItems>
              <FlexItem>
                  <Count/>
              </FlexItem>

              <FlexItem>
                  2
              </FlexItem>
          </FlexItems>
      </div>
  </Wrap>;
}

export default Partners;
